import React from 'react';
import './Login.css'

class Login extends React.Component {
    render() {
    return (
        <div className="login-container">
            <div className='title'>Enter login credentials in order to proceed to Joshua Dadson's portfolio</div>
            <form>
                <input type="text" value="" placeholder='Enter username'></input>
                <br/>
                <input type="text" value="" placeholder='Enter password'></input>
                <br/>
                <input type="submit" value="Sign In"/>
            </form>
        </div>
    )
    }
}

export default Login;
